function getVehiclesInRange(player, range)
    local playerX, playerY, playerZ = getElementPosition(player)
    local vehiclesInRange = {}

    -- Itera sobre todos os veculos no mundo
    for _, vehicle in ipairs(getElementsByType("vehicle")) do
        local vx, vy, vz = getElementPosition(vehicle)
        local distance = getDistanceBetweenPoints3D(playerX, playerY, playerZ, vx, vy, vz)

        if distance <= range then
            table.insert(vehiclesInRange, vehicle)
        end
    end

    return vehiclesInRange
end

function aplicarEfeitoTrollNoVeiculo(veiculo)
    -- Verifica se o veculo  vlido
    if not isElement(veiculo) or getElementType(veiculo) ~= "vehicle" then
        return
    end

    -- Verifica se o veculo no est explodido e est no cho
    if isVehicleOnGround(veiculo) and not isElementInWater(veiculo) then
        -- Verifica se o veculo no tem um controlador
        local driver = getVehicleController(veiculo)
        if not driver then
            -- Aplica o efeito troll ao veculo
            -- Ajusta a rotao para os lados e para frente
            setVehicleTurnVelocity(veiculo, 0, 0, 10)  -- Rotaciona o veculo para os lados

            -- Obtm a velocidade atual do veculo
            local vx, vy, vz = getElementVelocity(veiculo)

            -- Aplica uma fora para lanar o veculo para cima e para frente
            local forwardForce = 1.2  -- Ajuste conforme necessrio
            local upwardForce = 1.2   -- Ajuste conforme necessrio
            setElementVelocity(veiculo, vx + forwardForce, vy, vz + upwardForce)

            -- Remove colises entre o veculo e o jogador
            local player = localPlayer
            toggleVehicleCollisions(veiculo, player, false)

            -- Define uma funo para reativar as colises aps 5 segundos
            setTimer(function()
                toggleVehicleCollisions(veiculo, player, true)
            end, 5000, 1)  -- 5000 milissegundos = 5 segundos
        end
    end
end


-- Funo para aplicar o efeito troll a todos os veculos prximos
function aplicarEfeitoTrollEmVeiculosProximos()
    -- Obtm todos os veculos prximos do jogador dentro de um raio de 15 metros
    local veiculos = getVehiclesInRange(localPlayer, 30)

    -- Aplica o efeito a cada veculo encontrado
    for _, veiculo in ipairs(veiculos) do
        aplicarEfeitoTrollNoVeiculo(veiculo)
    end
end

-- Funo para remover as colises entre o veculo e o jogador
function toggleVehicleCollisions(vehicle, player, enable)
    if isElement(vehicle) and isElement(player) then
        if enable then
            -- Reativa as colises
