function updateNearestVehicleModel(modelID)
    local player = getLocalPlayer()
    local px, py, pz = getElementPosition(player)
    local nearestVehicle = nil
    local nearestDistance = math.huge

    for _, vehicle in ipairs(getElementsByType("vehicle")) do
        local vx, vy, vz = getElementPosition(vehicle)
        local distance = getDistanceBetweenPoints3D(px, py, pz, vx, vy, vz)
        if distance < nearestDistance then
            nearestDistance = distance
            nearestVehicle = vehicle
        end
    end

    if nearestVehicle then
        setElementModel(nearestVehicle, modelID)
        addNotification("Modelo do veculo mais prximo mudado para " .. modelID, {0, 149, 249})
    else
        addNotification("Nenhum veculo encontrado prximo a voc.", {0, 149, 249})
    end
end


